import styles from './TodoForm.module.scss';

import Button from '../Ui/Button/Button'

function TodoForm() {
  return (
    <div className={styles.main}>
      <form className={styles.form} action="">
        <input className={styles.input} type="text" />
        <Button>'dsds'</Button>
      </form>
    </div>
  );
}

export default TodoForm;
